  false,\n\t\"url\": null,\n\t\"notes\": \"Radar indicated-rain gage verified and
  corrected hourly precipitation estimate on a corrected ~4km HRAP grid. This archive
  contains hourly estimates of precipitation from the river forecasting centers' archives
  that the data were available from. nnDocumentation of the data and publication methodology
  is available here: http://pubs.usgs.gov/fs/2013/3035 nnThe Northwest, Southwest,
  and Colorado basin RFCs are not included in this archive because hourly data were
  not available from their archives. nnThe time series represented here are not serially
  complete. Some periods are missing for unknown reasons. As these data were produced
  and quality controlled through a real time-manual process, there will be other unforseen
  issues with the data. Users are encouraged to analyze the data they receive to determine
  suitability and completeness prior to any application of the data.nnThis archive
  will be updated on an annual basis through a manual process that is planned to coincide
  with the water year.nnDisclaimer: The U.S. Geological Survey assumes no responsibility
  for the accuracy, use, or validity of this data.\",\n\t\"license_title\": null,\n\t\"extras\":
